import Image from "react-bootstrap/Image";
import Layout from "../components/MyLayout.js";
const imageStyle = {
  backgroundSize : "cover",
  width : "50%"
}
const Projects = () => {
  const link = "https://images.pexels.com/photos/956981/milky-way-starry-sky-night-sky-star-956981.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500";
  return (
    <Layout>
      <div>
        <Image src={`${link}`} style={imageStyle} fluid/>
      </div>
    </Layout>
  );
}

export default Projects;
